package app.model;import java.time.LocalDateTime;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.Id;import javax.persistence.Table;@Entity@Table(name = "url_mappings")public class UrlMapping {    @Id    public Long id;    @Column(name = "short_url")    public String shortUrl;    @Column(name = "long_url")    public String longUrl;    @Column(name = "created_date")    public LocalDateTime createdDate;    @Column(name = "expiration_date")    public LocalDateTime expirationDate;}